                    {{ form_start(form) }}
                    
                    <div class=\"form-group row\">
                        <div class=\"col-md-6\">
                            {{ form_label(form.firstname) }}
                            {{ form_widget(form.firstname, {'attr': {'class': 'form-control', 'style': 'margin-bottom: 10px;'}}) }}
                        </div>
                        <div class=\"col-md-6\">
                            {{ form_label(form.lastname) }}
                            {{ form_widget(form.lastname, {'attr': {'class': 'form-control', 'style': 'margin-bottom: 10px;'}}) }}
                        </div>
                    </div>
                    
                    <div class=\"form-group row\">
                        <div class=\"col-md-6\">
                            {{ form_label(form.email) }}
                            {{ form_widget(form.email, {'attr': {'class': 'form-control', 'style': 'margin-bottom: 10px;'}}) }}
                        </div>
                        <div class=\"col-md-6\">
                            {{ form_label(form.telephone) }}
                            {{ form_widget(form.telephone, {'attr': {'class': 'form-control', 'style': 'margin-bottom: 10px;'}}) }}
                        </div>
                    </div>
                    
                    <div class=\"form-group row\">
                        <div class=\"col-md-6\">
                            {{ form_label(form.password) }}
                            {{ form_widget(form.password, {'attr': {'class': 'form-control', 'style': 'margin-bottom: 10px;'}}) }}
                        </div>
                        <div class=\"col-md-6\">
                            {{ form_label(form.roles) }}
                            {{ form_widget(form.roles, {'attr': {'class': 'form-control', 'style': 'margin-bottom: 10px;'}}) }}
                        </div>
                    </div>
                    
                    <button class=\"btn btn-primary my-3\" type=\"submit\">S'inscrire</button>
                    
                    {{ form_end(form) }}
                </form>
            </div>
        </div>
    </div>
{% endblock %}
